DROP TABLE IF EXISTS `schedule_delayed_jobs`;
CREATE TABLE `schedule_delayed_jobs`
(
    `id`         int(11) NOT NULL AUTO_INCREMENT,
    `priority`   int(11) DEFAULT 0 COMMENT '任务权重',
    `attempts`   int(11) DEFAULT 0 COMMENT '失败尝试次数',
    `handler`    mediumtext CHARACTER SET utf8mb4 COLLATE utf8mb4_bin DEFAULT NULL COMMENT '处理器',
    `last_error` text CHARACTER SET utf8mb4 COLLATE utf8mb4_bin DEFAULT NULL COMMENT '错误信息',
    `run_at`     datetime     DEFAULT NULL COMMENT '运行时间',
    `thread_id`  int(11) DEFAULT NULL COMMENT '线程id',
    `failed_at`  datetime     DEFAULT NULL COMMENT '发生错误时间',
    `queue`      varchar(191) DEFAULT NULL COMMENT '所在队列',
    `created_at` datetime     DEFAULT NULL COMMENT '创建时间',
    `updated_at` datetime     DEFAULT NULL COMMENT '更新时间',
    PRIMARY KEY (`id`),
    KEY          `delayed_jobs_priority` (`priority`,`run_at`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='任务队列';

