-- ----------------------------
-- Table structure for sys_users
-- ----------------------------
DROP TABLE IF EXISTS `sys_users`;
CREATE TABLE `sys_users`
(
    `id`                       int(11) NOT NULL AUTO_INCREMENT,
    `username`                 varchar(191) CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL DEFAULT '',
    `real_name`                varchar(191)                                            NOT NULL,
    `avatar`                   text                                                             DEFAULT NULL COMMENT '头像',
    `phone_number`             varchar(32) CHARACTER SET utf8 COLLATE utf8_unicode_ci  NOT NULL,
    `email`                    varchar(191) CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL DEFAULT '',
    `encrypted_password`       varchar(191) CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL DEFAULT '',
    `reset_password_token`     varchar(191) CHARACTER SET utf8 COLLATE utf8_unicode_ci          DEFAULT NULL,
    `reset_password_sent_time` datetime                                                         DEFAULT NULL,
    `login_count`              int(11) DEFAULT 0,
    `current_login_time`       datetime                                                         DEFAULT NULL,
    `last_login_time`          datetime                                                         DEFAULT NULL,
    `current_login_ip`         varchar(191) CHARACTER SET utf8 COLLATE utf8_unicode_ci          DEFAULT NULL,
    `last_login_ip`            varchar(191) CHARACTER SET utf8 COLLATE utf8_unicode_ci          DEFAULT NULL,
    `admin`                    tinyint(1) NOT NULL DEFAULT 0,
    `failed_attempts`          int(11) DEFAULT 10,
    `unlock_token`             varchar(191) CHARACTER SET utf8 COLLATE utf8_unicode_ci          DEFAULT NULL,
    `locked_time`              datetime                                                         DEFAULT NULL,
    `confirmation_token`       varchar(191) CHARACTER SET utf8 COLLATE utf8_unicode_ci          DEFAULT NULL,
    `confirmed_time`           datetime                                                         DEFAULT NULL,
    `confirmation_sent_time`   datetime                                                         DEFAULT NULL,
    `unconfirmed_email`        varchar(191) CHARACTER SET utf8 COLLATE utf8_unicode_ci          DEFAULT NULL,
    `state`                    tinyint(1) DEFAULT NULL COMMENT '0-启用 1-停用 2-账号过期 3-认证过期 4-账号锁定',
    `created_at`               datetime                                                         DEFAULT NULL,
    `updated_at`               datetime                                                         DEFAULT NULL,
    PRIMARY KEY (`id`),
    UNIQUE KEY `index_users_on_email` (`email`) USING BTREE,
    UNIQUE KEY `index_users_on_username` (`username`) USING BTREE,
    UNIQUE KEY `index_users_on_reset_password_token` (`reset_password_token`) USING BTREE,
    UNIQUE KEY `index_users_on_unlock_token` (`unlock_token`) USING BTREE,
    UNIQUE KEY `index_users_on_confirmation_token` (`confirmation_token`) USING BTREE,
    KEY                        `index_users_on_state` (`state`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=4 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci COMMENT='用户信息';

